<script src="https://cdnjs.cloudflare.com/ajax/libs/jspdf/1.3.5/jspdf.min.js"></script>
<script>
    $(document).ready(function () {
        var form = $('#pdf_container'),
            a3 = [1000, 1400]; // for A3 size paper width and height

        createPDF();

        function createPDF() {
            getCanvas().then(function (canvas) {
                var img = canvas.toDataURL("image/png"),
                    doc = new jsPDF({
                        unit: 'px',
                        format: 'a2',
                        margin: 20,
                    });

                // Ensure the content fits within the page
                var contentHeight = canvas.height;
                var contentWidth = canvas.width;
                var scaleFactor = Math.min(a3[0] / contentWidth, a3[1] / contentHeight);

                // Adjust canvas size
                form.width(contentWidth * scaleFactor).height(contentHeight * scaleFactor);

                // Add image to PDF with adjusted width and height
                doc.addImage(img, 'JPEG', 0, 0, contentWidth * scaleFactor, contentHeight * scaleFactor);

                // Save the PDF
                doc.save('techsolutionstuff.pdf');
            });
        }

        function getCanvas() {
            return html2canvas(form, {
                imageTimeout: 2000,
                removeContainer: true,
                scale: 1 / window.devicePixelRatio, // Adjust this value based on your needs
                scrollY: -window.scrollY
                // Add more options as needed
            });
        }
    });


</script>
